import React from "react";
import NewProduct from "../home/NewProduct";
import BestSeller from '../home/BestSeller'
const Home = () => {
  return (

    <div>
      <div className="jumbotron text-danger h1 font-weight-bold text-center">
      <img src="https://static.hd.co.th/system/image_attachments/images/000/153/667/original/desktop-_herobanner-pharma.jpg" alt="banner" className="img-fluid" />
        <h1 className="display-4">Welcome to E-Pharma</h1>
        <p className="lead">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
        <hr className="my-4" />
        <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
        <p className="lead">
          <a className="btn btn-primary btn-lg" href="#" role="button">Learn more</a>
        </p>
      </div>
      
      
      
      {/* New Product */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้ามาใหม่
       </h4>
         <NewProduct />   





      {/* Best Seller */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้าขายอย่างดี
       </h4>
        <BestSeller />

    </div>
  );
};

export default Home;
